import React from 'react';
import Slider from 'react-slick';
import { Box } from '@mui/material';

const ImageSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: true,
  };

  const images = [
    'https://scontent.fcrk3-2.fna.fbcdn.net/v/t39.30808-6/425775653_122100603146207557_477926010671292945_n.jpg?_nc_cat=101&ccb=1-7&_nc_sid=cc71e4&_nc_eui2=AeGgAztwtFpfN4Qawka5DWneRt6-e9ntUodG3r572e1Sh9xJJItHQsZiTGQZzgLorSTBy6nlexOizVpEC11e-PzZ&_nc_ohc=hAturPziC_wQ7kNvgGxTQou&_nc_ht=scontent.fcrk3-2.fna&oh=00_AYCAUCowbzhQFMAUyMWEyNpDPZeNVvrT695vzvR69Zypqw&oe=669D055A',
    'https://www.google.com/url?sa=i&url=https%3A%2F%2Fonline.hbs.edu%2Fblog%2Fpost%2Fbusiness-skills-every-professional-needs&psig=AOvVaw0sz8l6SEUPQ624wrKMXNTG&ust=1721267190057000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCKDM7476rIcDFQAAAAAdAAAAABAE',
    'https://via.placeholder.com/800x400?text=Slide+3',
  ];

  return (
    <Box sx={{ width: '80%', margin: 'auto' }}>
      <Slider {...settings}>
        {images.map((image, index) => (
          <Box key={index}>
            <img src={image} alt={`Slide ${index + 1}`} style={{ width: '100%', borderRadius: '10px' }} />
          </Box>
        ))}
      </Slider>
    </Box>
  );
};

export default ImageSlider;
